This full sample is also available in the Github repo . Start by adding the serde-dn NuGet package: dotnet add package serde-dn --prerelease Serde-dn uses C# 10 features, so until .NET 7 is released it requires the following flags to be added to the csproj file: <LangVersion>preview</LangVersion>
<EnablePreviewFeatures>true</EnablePreviewFeatures> You can now use the [GenerateSerialize] and [GenerateDeserialize] attributes to automatically implement serialization and deserialization for your own types. Don't forget to mark them partial! using Serde;
using Serde.Json; string output = JsonSerializer.Serialize(new SampleClass()); // prints: {"X":3,"Y":"sample"}
Console.WriteLine(output); var deserialized = JsonSerializer.Deserialize<SampleClass>(output); // prints SampleClass { X = 3, Y = sample }
Console.WriteLine(deserialized); [GenerateSerialize, GenerateDeserialize]
partial record SampleClass
{ // automatically includes public properties and fields public int X { get; init; } = 3; public string Y = "sample";
}

